function App() {
  const board = [];
  for (let i = 0; i < 8; i++) {
    const row = [];
    for (let j = 0; j < 8; j++) {
      row.push(<div style={{
        backgroundColor: (i + j) % 2 === 0 ? 'white' : 'black',
        width: '12.5%',
        height: '12.5%',
      }} />);
    }
    board.push(<div style={{ display: 'flex' }}>{row}</div>);
  }

  return (
    <div style={{ display: 'flex', flexDirection: 'column', height: '100vh', width: '100vw' }}>
      {board}
    </div>
  );
}

export default App;
